import React from "react";
import * as ReactDOMClient from "react-dom/client";
import ReactDOM from "react-dom";
import App from "./app";
import "./css/main.css";

// const app = ReactDOMClient.createRoot(document.getElementById("main"));
// app.render(<App />);

const users = ["Jack", "Max", "Leo", "Alex"];

const people = () => {
  return (
    <ol>
      {users.map((el, index) => (
        <li key={index}>{el}</li>
      ))}
    </ol>
  );
};

const link = ReactDOMClient.createRoot(document.getElementById("test"));
link.render(people);
